indexs = []
for i in range(len(values)):
    if values[i] == '"':
        indexs.append(i)
        
links = []

for i in range(len(indexs) - 1):
    links.append(values[indexs[i]+1:indexs[i+1]])


new_links = []
for i in links:
    if "https:" in i and "curseforge" in i:
        new_links.append(i)



#basic scraper

        

from selenium import webdriver
from selenium.webdriver.common.keys import Keys


driver = webdriver.Chrome("chromedriver.exe")

outputs = {}
for i in new_links:
    
    driver.get(i)
    elem = driver.find_element_by_xpath("/html/body/div[1]/main/div[1]/header/div[3]/div[1]/div/div[2]/span[3]")
    outputs[i] = elem.text
driver.close()

import json

with open("versions.json", "w") as f:
    json.dump(outputs, f)
        


